import React from "react";
import Icon from "@mdi/react";
import { mdiShieldHomeOutline } from "@mdi/js";

export default function HomIcon() {
  return (
    <div
      style={{
        flloat: "left",
        //marginLeft: "-80em",
        marginRight: "80em",
      }}
    >
      <Icon
        path={mdiShieldHomeOutline}
        title="User Profile"
        size={2}
        color="white"
      />
    </div>
  );
}
